import React from "react";
import food from "./sprites/apple.png";

const Food = props => {
  const style = {
    left: `${props.dot[0]}`,
    top: `${props.dot[1]}`
  };
  return (
    <div id="snakeFood">
      <img src={food} style="left: 30" alt="" />
    </div>
  );
};

export default Food;
